import React from "react"
import { Player } from 'video-react';


function Vplayer () {
  const [video, setVideo] = useState("videos/01.mp4");
  //let video = "videos/01.mp4"
  //let play = true

  function handleEnd () {
    setVideo("videos/02.mp4")
  }
  return (
    <>
        <Player
          controls={false}
          playing
          playsInline
          fluid={true}
          autoPlay
          style={{display: 'none'}}
          src={video}
          onEnded={(handleEnd)}
        />
    </>
  )
}

export default Vplayer
